function Noticia(conteudo, capa, titulo, status){

    this.conteudo = conteudo;
    this.capa = capa;
    this.titulo = titulo;
    this.status = status;

    return {
        conteudo: conteudo,
        titulo: titulo,
        capa: capa,
        status: status
    };

}

export default Noticia;
